import * as types from "./types";

export const authLogin = (payload) => {
    return {
        type: types.AUTH_LOGIN,
        payload
    }
}


export const authLogout = () =>{
    return {
        type: types.AUTH_LOGOUT,
        meta: {
            async: true,
            blocking: true,
            path: '/auth/logout',
            method: "POST",
        },
    }
}

export const authCheck = () => {
    return {
        type:types.AUTH_CHECK
    }
}
